package pass.regular;
import pass.PassUtil;
import pass.model.AnAbstractPassModel;
public class ARegularPassModel extends AnAbstractPassModel{
	@Override
	public Boolean isPass() {
		return PassUtil.regularPass(getTotalScore());
	}
}

val PASS_CUTOFF = 60;
fun regularPass aTotal = aTotal >= PASS_CUTOFF;
 
val PASS_CUTOFF = "40";
val HIGH_FINAL_CUTOFF = 80;

fun highFinalPass (aTotal, aFinal) = 
	 (aFinal >= HIGH_FINAL_CUTOFF) andalso
	 (aTotal >= PASS_CUTOFF);
	 
fun pass (aTotal, aFinal) = 
	regularPass(aTotal) orelse 
	highFinalPass(aTotal, aFinal);

